
CREATE TABLE IF NOT EXISTS `cities` (
  `id` int(10) unsigned NOT NULL,
  `country_id` int(10) unsigned NOT NULL DEFAULT '0',
  `zone_id` int(10) unsigned NOT NULL DEFAULT '0',
  `name` varchar(255) NOT NULL DEFAULT '',
  `geocode_id` int(10) unsigned DEFAULT NULL
) ENGINE=InnoDB AUTO_INCREMENT=432846 DEFAULT CHARSET=utf8;


ALTER TABLE `cities`
ADD PRIMARY KEY `id` (`id`);


CREATE TABLE IF NOT EXISTS `countries` (
  `id` int(10) unsigned NOT NULL,
  `name` varchar(255) NOT NULL DEFAULT ''
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

ALTER TABLE `countries`
ADD PRIMARY KEY `id` (`id`);



CREATE TABLE IF NOT EXISTS `geocodes` (
  `id` int(10) unsigned NOT NULL,
  `latitude` decimal(10,6) DEFAULT NULL,
  `longitude` decimal(10,6) DEFAULT NULL,
  `accuracy` int(2) unsigned NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


ALTER TABLE `geocodes`
ADD PRIMARY KEY `id` (`id`);


CREATE TABLE IF NOT EXISTS `pois` (
  `id` int(10) unsigned NOT NULL,
  `city_id` int(10) unsigned DEFAULT NULL,
  `subcategory_id` int(10) unsigned DEFAULT NULL,
  `name` varchar(255) NOT NULL DEFAULT '',
  `geocode_id` int(10) unsigned DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



ALTER TABLE `pois`
ADD PRIMARY KEY `id_primary` (`id`);

ALTER TABLE `pois`
ADD INDEX `city_id` (`city_id`);

CREATE TABLE IF NOT EXISTS `subcategories` (
  `id` int(10) unsigned NOT NULL,
  `name` varchar(255) NOT NULL DEFAULT ''
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



ALTER TABLE `subcategories`
ADD PRIMARY KEY `id` (`id`)

CREATE TABLE IF NOT EXISTS `zones` (
  `id` int(10) unsigned NOT NULL,
  `name` varchar(255) NOT NULL DEFAULT '',
  `country_id` int(10) unsigned NOT NULL DEFAULT '0'
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



ALTER TABLE `zones`
ADD PRIMARY KEY `id` (`id`);



